function Character() {
  return ([(
    <Question chars={characters}/>),
    (characters.map((character => 
    <Container style={{margin:'0px', marginTop:'50px', marginLeft:'95px'}}>
        <Card style={{float:"left",  width:'100px', height:'10', margin:'-8px', padding:'0px', backgroundColor:'#e0e0e0', alignItems:'center', textAlign:'center'}}>
     <Card.Img variant="top" width='80px' height='80px' src={character.image} />
      <Card.Body>
        <Card.Title style={{fontSize:'7px'}}>{character.name}</Card.Title>
        </Card.Body>
        </Card>
    </Container>
    ))
  )]);

}

